import React from "react";
import Background from "../img/pic01.jpg";
import "../img";

const Project = ({ project }) => {
  const style = {
    backgroundImage: `url(${Background})`
  };

  return (
    <article style={style}>
      {/* <span class="image">
        <img src="../img/pic01.jpg" alt="tile-background" />
      </span> */}
      <a
        href="http://github.com/1sdc0d3r"
        target="_blank"
        rel="noopener noreferrer"
      >
        <h2>{project.title}</h2>
      </a>
      <p>{project.content}</p>
    </article>
  );
};

export default Project;
